Encrypt the data string using the HMAC-SHA256 algorithm. Use the secretKey parameter from the DataProvider as the key. Here's an example function to perform this encryption: // Function to encrypt a string using HMAC-SHA256
func EncryptHMACSHA256(message, secretKey string) string { // Create a new HMAC object using SHA256 hmacSha256 := hmac.New(sha256.New, []byte(secretKey)) // Write the message to the HMAC object hmacSha256.Write([]byte(message)) // Compute the HMAC code encryptedMessage := hmacSha256.Sum(nil) // Convert the result to a hexadecimal string return hex.EncodeToString(encryptedMessage)
} Note: The resulting encrypted string is encoded in hexadecimal, not Base64.
